import React from "react";
import  useFetch from "../service/StudentService"; 
import Card from '../components_example/Card';

function FuncCardSet(props) {
    const { loading, data } = useFetch('getById','1');
    console.log(data);
    console.log(loading);
  
    return (
      <div>
        {loading && <p>loading...</p>}
        {data &&
          data.length > 0 &&
          data.map(student => <Card key = {student.id} info = {student}/>)}
      </div>
    );
  }

  export default FuncCardSet;
